import React,{useState} from 'react'

function counter() {
const [state, setstate] = useState( 0);

 const Decrement =()=>{
     setstate(state - 1)
 }

 const Increment =()=>{
   setstate((state + 1))
 }
  return (
    <div className="container ">
         <div>
              <button onClick={Decrement}>-</button>
              <span>Count :{state}</span>
              <button onClick={Increment}>+</button>
         </div>
    </div>
  )
}

export default counter
